  false,\n\t\"url\": null,\n\t\"notes\": \"In September 2013, WSI, a Quantum Spatial
  company (QSI), was contracted by the Puget Sound LiDAR Consortium (PSLC) to collect
  Light Detection and Ranging (LiDAR) data for three areas of interest (AOIs) in the
  greater Seattle, Washington area. The individual AOIs include the Cedar River Watershed
  and Floodplain, Lake Youngs Reservoir, and the SCL/Tolt Reservoir, herein all referred
  to as the Cedar Watershed LiDAR project. Data were collected to aid PSLC in assessing
  the topographic and geophysical properties of the study area. On April 11, 2014,
  a section of the SCL/Tolt Reservoir AOI (Delivery 1) was delivered to the PSLC.
  This report accompanies the remaining section of the SCL/Tolt Reservoir AOI, the
  Cedar River Watershed AOI, and the Lake Youngs Reservoir AOI, all collectively referred
  to as Delivery 2. Included are Delivery 2 contract specifications, data acquisition
  procedures, processing methods, and analysis of the complete and final dataset including
  LiDAR accuracy and density. The average first-return density of LiDAR data for the
  Cedar Watershed LiDAR project was 1.15 points/ft^2 (12.41 points/m2) while the average
  ground classified density was 0.25 points/ft^2 (2.67 points/m^2. Presented in the
  lidar report are the spatial distribution of average first return densities and
  ground return densities for each 30 m by 30 m cell.\",\n\t\"license_title\": null,\n\t\"extras\":
